import React from 'react';
import Navbar from './navbar';
import BlackBoard from './blackboard';
import CurrInfo from './currinfo';

const Home = () => {
    return (
        <div class="container">
            <div class = "row">
                <Navbar />
            </div>
            <div class = "row">
                <div class = "column">
                    <CurrInfo />
                </div>
                <div class = "column">
                    <BlackBoard />
                </div>
            </div>
        </div>
        
    );
}

export default Home
